import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Extract all product prices
    const prices = await page.$$eval('.product-price', priceElements => 
      priceElements.map(el => {
        const priceText = el.textContent.trim();
        // Extract just the main price (ignore original price if present)
        const mainPrice = priceText.split('$')[1]?.split(' ')[0] || priceText;
        return parseFloat(mainPrice.replace('$', ''));
      })
    );

    // Extract product titles for context
    const titles = await page.$$eval('.product-title', titleElements => 
      titleElements.map(el => el.textContent.trim())
    );

    // Create extracted data object
    const extractedData = {};
    titles.forEach((title, index) => {
      extractedData[title] = prices[index];
    });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
